INSERT INTO `wuzhe213text` (`old_id`, `old_text`, `old_flags`) VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(2,'mov r1, #0x100\n\nmov','utf-8'),(3,'mov r1, #0x100','utf-8'),(4,'kjk;\n\n== dfadfa ==','utf-8'),(5,'\n\n== arm assembly ==','utf-8'),(6,'\n== arm has seven mode: ==\n\nusr, user, The normal ARM program execution state\nfiq, fast interrupt request,  Designed to support a data transfer or channel process\nirq, interrupt request, Used for general-purpose interrupt handling\nsys, system, A privileged user mode for the operating system\nsvc, supervisor, Protected mode for the operating system\nabt, abort, Entered after a data or instruction prefetch abort\nund, undefined, Entered when an undefined instruction is executed\n\n\n\n== registers ==\n\nrp0-r15, general purpose registers\ncpsr, \nspsr,\n\n\ncpsr:\nn,z,c,v ...... i, f, t, m4,m3,m2,m1,m0\n\nn, negative/less than\nz, zero\nc, carry, borrow, extend\nv, overflow\n\ni, irq disable\nf, fiq disable\nt, thumb bit\n\nm4...m0, mode, visible arm registers\n10000, usr, r14-r0, pc, cpsr\n10001, fiq, r7-r0, r14_fiq-r8_fiq, pc, cpsr, spsr_fiq\n10010, irq, r12-r0, r14_irq, r13_irq, pc, cpsr, spsr_irq\n10011, svc, r12-r0, r14_svc, r13_svc, pc, cpsr, spsr_svc\n10111, abt, r12-r0, r14_abt, r13_abt, pc, cpsr, spsr_abt\n11011, und, r12-r0, r14_und, r13_und, pc, cpsr, spsr_und\n11111, sys, r14-r0, cpsr, spsr\n\nusr and sys have the same registers can be accessed\nfiq has r8-r14, pc, for it\'s own\n\n\n\n\n== s3c2440 registers: ==\n\nRegister 14\nThis register is used as the subroutine link register. \nThis receives a copy of R15 when a Branch and Link (BL) instruction is executed. \nRest of the time it may be treated as a general-purpose register. \nThe corresponding banked registers R14_svc, R14_irq, R14_fiq, R14_abt and R14_und are similarly used to hold the return values of R15 when interrupts and exceptions arise, or when Branch and Link instructions are executed within interrupt or exception routines.\n\nRegister 15\nThis register holds the Program Counter (PC). In ARM state, bits [1:0] of R15 are zero and bits [31:2] contain the PC. In THUMB state, bit [0] is zero and bits [31:1] contain the PC.\n\nRegister 16\nThis register is the CPSR (Current Program Status Register). This contains condition code flags and the current mode bits.','utf-8'),(7,'\n== arm has seven mode: ==\n\nusr, user, The normal ARM program execution state\nfiq, fast interrupt request,  Designed to support a data transfer or channel process\nirq, interrupt request, Used for general-purpose interrupt handling\nsys, system, A privileged user mode for the operating system\nsvc, supervisor, Protected mode for the operating system\nabt, abort, Entered after a data or instruction prefetch abort\nund, undefined, Entered when an undefined instruction is executed\n\n\n\n== registers ==\n\nrp0-r15, general purpose registers\ncpsr, \nspsr,\n\n\ncpsr:\nn,z,c,v ...... i, f, t, m4,m3,m2,m1,m0\n\nn, negative/less than\nz, zero\nc, carry, borrow, extend\nv, overflow\n\ni, irq disable\nf, fiq disable\nt, thumb bit\n\nm4...m0, mode, visible arm registers\n10000, usr, r14-r0, pc, cpsr\n10001, fiq, r7-r0, r14_fiq-r8_fiq, pc, cpsr, spsr_fiq\n10010, irq, r12-r0, r14_irq, r13_irq, pc, cpsr, spsr_irq\n10011, svc, r12-r0, r14_svc, r13_svc, pc, cpsr, spsr_svc\n10111, abt, r12-r0, r14_abt, r13_abt, pc, cpsr, spsr_abt\n11011, und, r12-r0, r14_und, r13_und, pc, cpsr, spsr_und\n11111, sys, r14-r0, cpsr, spsr\n\nusr and sys have the same registers can be accessed\nfiq has r8-r14, pc, for it\'s own\n\n== s3c2440 registers: ==\n\nRegister 14\nThis register is used as the subroutine link register. \nThis receives a copy of R15 when a Branch and Link (BL) instruction is executed. \nRest of the time it may be treated as a general-purpose register. \nThe corresponding banked registers R14_svc, R14_irq, R14_fiq, R14_abt and R14_und are similarly used to hold the return values of R15 when interrupts and exceptions arise, or when Branch and Link instructions are executed within interrupt or exception routines.\n\nRegister 15\nThis register holds the Program Counter (PC). In ARM state, bits [1:0] of R15 are zero and bits [31:2] contain the PC. In THUMB state, bit [0] is zero and bits [31:1] contain the PC.\n\nRegister 16\nThis register is the CPSR (Current Program Status Register). This contains condition code flags and the current mode bits.','utf-8'),(8,'\n== arm has seven mode: ==\n\nusr, user, The normal ARM program execution state\nfiq, fast interrupt request,  Designed to support a data transfer or channel process\nirq, interrupt request, Used for general-purpose interrupt handling\nsys, system, A privileged user mode for the operating system\nsvc, supervisor, Protected mode for the operating system\nabt, abort, Entered after a data or instruction prefetch abort\nund, undefined, Entered when an undefined instruction is executed\n\n\n\n== registers ==\n\nrp0-r15, general purpose registers<cr>\ncpsr, \nspsr,\n\n\ncpsr:\nn,z,c,v ...... i, f, t, m4,m3,m2,m1,m0\n\nn, negative/less than\nz, zero\nc, carry, borrow, extend\nv, overflow\n\ni, irq disable\nf, fiq disable\nt, thumb bit\n\nm4...m0, mode, visible arm registers\n10000, usr, r14-r0, pc, cpsr\n10001, fiq, r7-r0, r14_fiq-r8_fiq, pc, cpsr, spsr_fiq\n10010, irq, r12-r0, r14_irq, r13_irq, pc, cpsr, spsr_irq\n10011, svc, r12-r0, r14_svc, r13_svc, pc, cpsr, spsr_svc\n10111, abt, r12-r0, r14_abt, r13_abt, pc, cpsr, spsr_abt\n11011, und, r12-r0, r14_und, r13_und, pc, cpsr, spsr_und\n11111, sys, r14-r0, cpsr, spsr\n\nusr and sys have the same registers can 