ual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n\n* [https://en.wikipedia.org/wiki/Help:Wiki_markup]','utf-8'),(17,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n\n* [https://en.wikipedia.org/wiki/Help:Wiki_markup Wiki markup]','utf-8'),(18,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n\n* [https://en.wikipedia.org/wiki/Help:Wiki_markup MediaWiki markup]','utf-8'),(19,'hardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, burnFileToNand2440','utf-8'),(20,'\nObject\n: light on jz2440\'s led D10\n\nhardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, \n: burnFileToNand2440\n\nHow to do\n: from jz2440\'s sch file jz2440 > Tools_And_Meterials > sch > JZ2440v2_sch.pdf in my pan.baidu.com, we know that D10 is connected to nLED_1, witch connected to cpu\'s EINT4/GPF4 port.\n: from cpu s3c2440\'s S3C2440A_UserManual_Rev13.pdf, we know that GFP4 is a general purpose port, can also configure to eint port.\n: \n\nmakefile\n: led_on.bin: led_on.s\n:','utf-8'),(21,'\nObject\n: light on jz2440\'s led \'\'\'D10\'\'\'\n\nhardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, \n: burnFileToNand2440\n\nHow to do\n: from jz2440\'s sch file jz2440 > Tools_And_Meterials > sch > JZ2440v2_sch.pdf in my pan.baidu.com, we know that one side of D10 is connected to \'\'\'nLED_1\'\'\', witch connected to cpu\'s EINT4/\'\'\'GPF4\'\'\' port, and the other side of D10 is connected to \'\'\'3.3v\'\'\'.\n: So, to let D10 light on, we need to put nLED_1 to \'\'\'low vol\'\'\'.\n: from cpu s3c2440\'s S3C2440A_UserManual_Rev13.pdf, we know that GFP4 is a general purpose port, can also configure to eint port.\n: search for GPF4, you will know that GPF4 can be controled  by \'\'\'GPFCON\'\'\'.\n: GPFCON\'s bit 9 and bit 8 is used to control GPF4\'s function INPUT/OUTPUT/EINT.\n: We need to set GPF4 as function \'\'\'OUTPUT\'\'\', and set it to low vol. \n: So, we should set  GPFCON to [\'\'\'9:8\'\'\'] to 0x01 to work as OUTPUT.\n:: we can do this by using \"ldr rp, =0; mov r1, 0x100\"\n\nmakefile\n: led_on.bin: led_on.s\n:','utf-8'),(22,'\nObject\n: light on jz2440\'s led \'\'\'D10\'\'\'\n\nhardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, \n: burnFileToNand2440\n\nHow to do\n: From jz2440\'s sch file jz2440 > Tools_And_Meterials > sch > JZ2440v2_sch.pdf in my pan.baidu.com, we know that one side of D10 is connected to \'\'\'nLED_1\'\'\', witch connected to cpu\'s EINT4/\'\'\'GPF4\'\'\' port, and the other side of D10 is connected to \'\'\'3.3v\'\'\'.\n: So, to let D10 light on, we need to put nLED_1 to \'\'\'low vol\'\'\'.\n: From cpu s3c2440\'s S3C2440A_UserManual_Rev13.pdf, we know that GFP4 is a general purpose port, can also configure to eint port.\n: Search for GPF4, you will know that GPF4 can be controled  by \'\'\'GPFCON\'\'\' at address 0x56000050.\n: GPFCON\'s bit 9 and bit 8 is used to control GPF4\'s function INPUT/OUTPUT/EINT.\n: We need to set GPF4 as function \'\'\'OUTPUT\'\'\', and set it to low vol. \n: So, we should set  GPFCON to [\'\'\'9:8\'\'\'] to 0x01 to work as OUTPUT.\n:: We can do this by using \"ldr r0, =0x56000050; mov r1, 0x100\"\n: To set GPF4 to low vol, we can see there is a GPFDATA at address 0x56000054, to GPF4 to low vol, we need to set GPFDATA\'s pin 4 to 1\n:: We can do this by using \"ldr r0, =0x56000054; mov r1, 0x8\"\n\nmakefile\n: led_on.bin: led_on.s\n:','utf-8'),(23,'\nObject\n: light on jz2440\'s led \'\'\'D10\'\'\'\n\nhardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, \n: burnFileToNand2440\n\nHow to do\n: From jz2440\'s sch file jz2440 > Tools_And_Meterials > sch > JZ2440v2_sch.pdf in my pan.baidu.com, we know that one side of D10 is connected to \'\'\'nLED_1\'\'\', witch connected to cpu\'s EINT4/\'\'\'GPF4\'\'\' port, and the other side of D10 is connected to \'\'\'3.3v\'\'\'.\n: So, to let D10 light on, we need to put nLED_1 to \'\'\'low vol\'\'\'.\n: From cpu s3c2440\'s S3C2440A_UserManual_Rev13.pdf, we know that GFP4 is a general purpose port, can also configure to eint port.\n: Search for GPF4, you will know that GPF4 can be controled  by \'\'\'GPFCON\'\'\' at address 0x56000050.\n: GPFCON\'s bit 9 and bit 8 is used to control GPF4\'s function INPUT/OUTPUT/EINT.\n: We need to set GPF4 as function \'\'\'OUTPUT\'\'\', and set it to low vol. \n: So, we should set  GPFCON to [\'\'\'9:8\'\'\'] to 0x01 to work as OUTPUT.\n:: We can do this by using \"ldr r0, =0x56000050; mov r1, 0x100\"\n: To set GPF4 to low vol, we can see there is a GPFDATA at address 0x56000054, to GPF4 to low vol, we need to set GPFDATA\'s pin 4 to 0\n:: We can do this by using \"ldr r0, =0x56000054; mov r1, 0x0\"\n\nmakefile\n: led_on.bin: led_on.s\n:','utf-8'),(24,'\nObject\n: light on jz2440\'s led \'\'\'D10\'\'\'\n\nhardware\n: jz2440 board\n: openjtag\nos\n: linux mint 17 mat 64bit\nsoftware\n: oflash, \n: burnFileToNand2440\n\nHow to do\n: From jz2440\'s sch file jz2440 > Tools_And_Meterial