ux on rpi2\n: [http://archlinuxarm.org/platforms/armv7/broadcom/raspberry-pi-2 Raspberry Pi 2 installs archlinux]','utf-8'),(56,'follow the link to install archlinux on rpi2: [http://archlinuxarm.org/platforms/armv7/broadcom/raspberry-pi-2 Raspberry Pi 2 installs archlinux]','utf-8'),(57,'Please follow the link: [http://archlinuxarm.org/platforms/armv7/broadcom/raspberry-pi-2 Raspberry Pi 2 installs archlinux]','utf-8'),(58,'to install archlinux on raspberry pi 2, can get info from [[raspberry pi2 installs archlinux]]','utf-8'),(59,'to install archlinux on raspberry pi 2, can get info from [[Raspberry pi2 installs archlinux]]','utf-8'),(60,'to install archlinux on raspberry pi 2, can get info from [[Raspberry pi2 installs archlinux]]\n\nafter install, you may need to do a command: \n: pacman -Sy\nto refresh the information source.\n\nAnd then(update may cause problem, with caution):\n: pacman -Syu\nto update the system.\n\nif you wan compile something, better install base-devel\n: pacman -S base-devel','utf-8'),(61,'run as user of root\n\ncreate a user named tx\n: useradd tx\n\ncreate tx\'s home directory\n: mkdir /home/tx\n: chown tx:tx /home/tx\n\nchange password of tx, or it can\'t access the system\n: passwd tx\n\nadd tx to sudoers, or it can\'t get root\'s privileges by sudo command\n: visudo\n: add oneline:\n:: tx ALL=(ALL) ALL','utf-8'),(62,'to install archlinux on raspberry pi 2, can get info from [[Raspberry pi2 installs archlinux]]\n\n\ncreate a normal user [[Add user in archlinux]]\n\n\nafter install, you may need to do a command: \n: pacman -Sy\nto refresh the information source.\n\nAnd then(update may cause problem, with caution):\n: pacman -Syu\nto update the system.\n\nif you wan compile something, better install base-devel\n: pacman -S base-devel','utf-8'),(63,'to install archlinux on raspberry pi 2, can get info from [[Raspberry pi2 installs archlinux]]\n\n\ncreate a normal user [[Add user in archlinux]]\n\n\nafter install, you may need to do a command: \n: pacman -Sy\nto refresh the information source.\n\n\nAnd then(update may cause problem, with caution):\n: pacman -Syu\nto update the system.\n\n\nif you wan compile something, better install base-devel\n: pacman -S base-devel','utf-8'),(64,'Got from link: [http://lostindetails.com/blog/post/Compiling-a-kernel-module-for-the-raspberry-pi-2]','utf-8'),(65,'Got from link: [http://lostindetails.com/blog/post/Compiling-a-kernel-module-for-the-raspberry-pi-2 click here to go]','utf-8'),(66,'Got from link: [http://lostindetails.com/blog/post/Compiling-a-kernel-module-for-the-raspberry-pi-2 click here to go]\n\n\n== Building the kernel ==\n\nGet the tools: \n: git clone https://github.com/raspberrypi/tools\n\n\nSet the environment variable CCPREFIX to point to the master tools:\n: export CCPREFIX=/home/INSERT YOUR USER NAME HERE/tools-master/arm-bcm2708/arm-bcm2708-linux-gnueabi/bin/arm-bcm2708-linux-gnueabi-\n\n\nGet the kernel source by:\n: git clone https://github.com/raspberrypi/tools\n\n\nSet the environment variable KERNEL_SRC to point to the kernel source:\n: export KERNEL_SRC=/home/INSERT YOUR USER NAME HERE/linux\n\n\non the raspberry pi execute:\n: FIRMWARE_HASH=$(zgrep \"* firmware as of\" /usr/share/doc/raspberrypi-bootloader/changelog.Debian.gz | head -1 | awk \'{ print $5 }\')\n\nexecute:\n: KERNEL_HASH=$(wget https://raw.github.com/raspberrypi/firmware/$FIRMWARE_HASH/extra/git_hash -O -)\n\nback on ubuntu checkout the correct version of the kernel source code inside the KERNEL_SRC directory using git:\n: git checkout INSERT_KERNEL_HASH_HERE\n\nexecute make mrproper in the KERNEL_SRC directory\n\n\ncopy /proc/config.gz from the raspberry pi to the KERNEL_SRC directory\n: e.g. scp pi@ipaddress:/proc/config.gz ./ and unpack it: zcat config.gz > .config\n\n\nexecute make ARCH=arm CROSS_COMPILE=${CCPREFIX} oldconfig\n\n\nexecute make ARCH=arm CROSS_COMPILE=${CCPREFIX}\n\n\nand wait\n\n\n\n== Building Kernel modules ==\n\nPREFIX = /home/[USER]/tools-master/arm-bcm2708/arm-bcm2708-linux-gnueabi/bin/arm-bcm2708-linux-gnueabi-\n    make ARCH=arm CROSS_COMPILE=$(PREFIX) -C /home/[USER]/linux M=$(SRC) modules','utf-8'),(67,'Got from link: [http://lostindetails.com/blog/post/Compiling-a-kernel-module-for-the-raspberry-pi-2 click here to go]\nOne step from the link is wrong: to get the kernel source, the command should be: git clone https://github.com/raspberrypi/linux\n\n== Building the kernel ==\n\nGet the tools: \n: git clone https://github.com/raspberrypi/tools\n\n\nSet the environment variable CCPREFIX to point to the master tools:\n: export CCPREFIX=/home/INSERT YOUR USER NAME HERE/tools-master/arm-bcm2708/arm-bcm2708-linux-gnueabi/bin/arm-bcm2708-linux-gnueabi-\n\n\nGet the kernel source by:\n: git clone https://github.com/raspberrypi/linux\n\n\nSet the environment variable KERNEL_SRC to point to the kernel source:\n: export KERNEL_SRC=/home/INSERT YOUR USER NAME HERE/linux\n\n\non the raspberry pi execute:\n: FIRMWARE_HASH=$(zgrep \"* firmware as of\" /usr/share/doc/raspberrypi-bootloader/changelog.Debian.gz | head -1 | awk \'{ print $5 }\')\n\nexecute:\n: KERNEL_HASH=$(wget https://raw.github.com/raspberrypi/firmware/$FIRMWARE_HASH/extra/git_hash -O -)\n\nback on ubuntu checkout the correct version of the kernel source code inside the KERNEL_SRC directory using git:\n: git checkout INSERT_KERNEL_HASH_HERE\n\nexecute make mrproper in the KERNEL_SRC directory\n\n\ncopy /proc/config.gz from the raspberry pi to the KERNEL_SRC directory\n: e.g. scp pi@ipaddress:/proc/config.gz ./ and unpack it: zcat config.gz > .config\n\n\nexecute make ARCH=arm CROSS_COMPILE=${CCPREFIX} oldconfig\n\n\nexecute make ARCH=arm CROSS_COMPILE=${CCPREFIX}\n\n\nand wait\n\n\n\n== Building Kernel modules ==\n\nPREFIX = /home/[USER]/tools-master/arm-bcm2708/arm-bcm2708-linux-gnueabi/bin/arm-bcm2708-linux-gnueabi-\n    make ARCH=arm CROSS_COMPILE=$(PREFIX) -C /home/[USER]/linux M=$(SRC) modules','utf-8'),(68,'\n== environment ==\nhardware: raspber